import React from 'react';
import Hero from './Hero';
import Work from './Work';
import About from './About';
import Contact from './Contact';
import Header from './Header';

function App() {
  return (
    <>
      <Header />
      <Hero />
      <Work />
      <About />
      <Contact />
    </>
  );
}

export default App;
